import { useNavigate } from "react-router-dom";
import { Button } from "react-bootstrap";
import { HiArrowNarrowLeft } from "react-icons/hi";

export const GoBack = () => {
    let navigate = useNavigate();
    return (
        <Button className="px-1"
            onClick={() => navigate(-1)}
            variant="warning"
            title="Back">
            <HiArrowNarrowLeft /> חזור
        </Button>
    )
}

export const View = (props) => {
    console.log(props)
    return (
        <Button onClick={() => {window.location.href = `/diners/${props.queue}/${props.id}`}}>
        <img src="https://img.icons8.com/ios-glyphs/30/ab5e2a/visible--v1.png" />
        </Button>
    )
}

export const Reservation = (props) => {
    return (
        <Button onClick={() => {window.location.href = `/diners/sit/${props.id}/reservation`}}>
        {/* <img src="https://img.icons8.com/pastel-glyph/30/ab5e2a/meal--v1.png"/> */}
        <img src="https://img.icons8.com/ios-filled/30/ab5e2a/meal.png"/>
        </Button>
    )
}
